【作動温度】-40℃- +105℃ <br />
<br />
【商品内容】<br />
　　(1)UVカットクリスタルHIDバルブ 2球<br />
　　(2)交流式デジタルバラスト 2個<br />
　　(3)結束バンド・ビスナット 一式<br />
　　(4)[リレーレス配線 2本]もしくは[リレーハーネス 1本]<br />
　　(5)取扱説明書（保証書)<br />
<br />
【保証期間】<br />
　　バルブ：発送日より、1年間<br />
　　バラスト：発送日より、5年間<br />
