<br />
【初期不良対応期間】発送日より、7営業日まで<br />
<br />
【商品について】<br />
・電流・電圧設定を再チューン。立ち上がり直後の光束量が増大し、点灯の切れが増しました。<br />
・最新高性能ICチップ駆動で瞬時点灯し、瞬時出力を停止する保護回路を搭載、バルブ・バラスト共にトラブルを最小限に抑えます。<br />
・安全性・耐久性・安定性向上、完全防水加工済。<br />
・取付け場所スペースの悩みが解消、より幅広い車種に対応できます。 カプラーオン設計、防水カプラーコネクター装着。<br />
・最新超薄デジタルバラストは始動電流が低く、ヘッドライトに安定的電流を供給可能です。 <br />
　　※完全防水 : バルブ・バラスト
<br />
<br />
【リレーレス配線付きキット】 ポン付けするだけの簡単取付できます。 <br />
【リレーハーネス付きキット】 
電力不足や車体の相性による不点灯やチラツキを防ぐ「電源強化リレーハーネス」がセット。<br />
電力不足の状態になるかどうかは、お車の環境によります。
<br />
<br />
※リレーレス配線付きキットをご購入後、初期対応期間内発送日より、7営業日までにご連絡頂ければ、送料お客様ご負担となりますが、リレーハーネスと交換させて頂くことができます。

